    false,nt"url": null,nt"notes": "This Master Development Plan for Tewaukon
    National Wildlife Refuge is divided into the following six parts: general characteristics,
    management objectives, development, management, operation and staff, and program
    schedules.  Part 1 deals with a general description of the refuge and provides information
    concerning the location, size, relationship to State and other Federal areas, and
    the geophysical, climatological and biological characteristics.  Part 2 defines
    the basic management objectives of the refuge, and summarizes use of the refuge
    by each important wildlife species, or groups of species.  Part 3 provides information
    on the developments, existing and proposed, needed to attain management objectives.
    The developments which are proposed are based on detailed biological and engineering
    reconnaissance and study.  Part 4 describes the basic management plans which will
    be applied on the refuge.  The management plans for water, marsh, cropland and other
    areas are discussed as concisely as possible.  Part 5 deals primarily with the protective,
    custodial, and operational requirements of the refuge. Law enforcement, hazards
    such as fires and floods, and maintenance requirements are outlined.  Part 6 provides
    the fiscal data--the estimated costs for operation and maintenance of the physical
    plant, management of various resources, and the cost estimates for land acquisition
    and development.",nt"license_title": "License Not Specified",nt"extras":
